After last night's @michelinguide ceremony, we're pleased to congratulate the Chicago restaurants who received the coveted stars this year! In particular, @smythchicago received its third Michelin star, joining @alinearestaurant as the only other restaurant in the city to receive Michelin's highest star rating.

Additionally, @atelier.chicago and @indiennechicago each received one Michelin star, bringing the number of one-starred restaurants in Chicago up to 18. Plus, Michelin added five new Chicago restaurants to its Bib Gourmand list this year, including: @boonieschicago, @cellardoorprovisions, @yaoyao_chicago, @pompettechicago and @unionlogansquare.

